import ListItem from "./listItem"
import {Router} from "react"

const renderList = (item, type, page, data) => {
  let container = []

  if (!type['highlighted'] && !data['display']['nonehighlighted']) return <div></div>

  for (let i = 0; i < page; i++) {
    if (!item[i]) break
    container.push(item[i])
  }
  
  if (type) {
    return container.map((item, i) => (
      <Router path="www.google.com">
          <ListItem
            key={`${type}${i}D`}
            item1={item[0].data}
            item2={item[1].data}
            item3={item[2].data}
            item4={item[3].data}
            item5={item[4].data}
            item6={item[5].data}
          />
      </Router>
    ), this);
  }
};

export default renderList
